             throw  new   InvalidMoneyAmountException () ; 
         } 
         this . money   +=   amount ; 
     }

public   void   withdraw ( int   amount )   throws  InvalidMoneyAmountException   { 
         if  ( this . money   <   amount   ||   amount   ==   0 )   { 
             throw  new   InvalidMoneyAmountException () ; 
         } 
         this . money   -=   amount ; 
     }

public   int   getAmount ()   { 
         return  this . money ; 
